import React from 'react';
import './button.scss';

const Button = ({ onClick }) => {
    return (
        <button
            style={{
                width: '80px',
                borderRadius: '5px',
                marginLeft: '10px',
                fontSize: '16px'
            }}
            onClick={onClick}>Add Item</button>
    )
}

export default Button;
